import React from 'react'
import styles from "./Main.module.css";
import Menu from './MenuBar/Menu';

const Main = () => {
  return (
    <div className={styles.main}>
      <Menu />
      <Routes>
        <Route path="/">Home</Route>
        <Route path="/Destination"></Route>
        <Route path=""></Route>
        <Route></Route>
      </Routes>
    </div>
  )
}

export default Main
